function dataEvent(data, requestURL)
{
	script.log("Data received, request URL :"+requestURL+"\nContent :\n" +data);
	var variableNames = ["var1", "var2"];
	var data1 = data;
	var index = data.indexOf("<value>");
	var i = 0;
	while (index >= 0) {
		var value = data1.substring(index + 7, index + 9);
		data1 = data1.substring(index + 9, 9999);
		index = data1.indexOf("<value>");
		script.log(value);
		local.values[variableNames[i]].set(value == "01");
		i = i + 1;
	}
}

